const OrderDetails: React.FC<{selectedOrder: OrderInterface}> = ({selectedOrder}) => {
  return (
    <div>
      <div>
        <p>{selectedOrder.shippingInfo.userName}</p>
        <p>{selectedOrder.shippingInfo.shippingAddress.doorNo}, {selectedOrder.shippingInfo.shippingAddress.street}, {selectedOrder.shippingInfo.shippingAddress.city}</p>
      </div>

    </div>
  );
};

export default OrderDetails;
